import ExpenseItem from "./Components/ExpenseItem";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const expensesGoods = expenses.map((exp) => (
    <ExpenseItem
      key={exp.id}
      title={exp.title}
      date={exp.date}
      Amount={exp.amount}
    />
  ));
  return (
    <div>
      <h2>Expense Traker</h2>
      {/* <ExpenseItem /> */}
      {expensesGoods}
    </div>
  );
}

export default App;
